import React from "react";
import { Header } from "./../../components/header";
import { Card } from "../../components/card";
import { Column, Container } from "./styles";
import { UserInfomation } from "../../components/UserInfo";

const Feed = () => {
  return (
    <>
      <Header />
      <Container>
        <Column flex={3}>
          <Card />
        </Column>
        <Column flex={1}>
          <UserInfomation
            name="eduardo Ngoca"
            image="./logo.png"
            percentual="80"
          />
        </Column>
      </Container>
    </>
  );
};

export { Feed };
